import { BrowserRouter as Router, Routes, Route  } from 'react-router-dom';
import 'assets/scss/style.scss';
import LandingPage from "pages/LandingPage";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>

        </Routes>
        <Route path="/" component={LandingPage}></Route>
      </Router>
    </div>
  );
}

export default App;
